import React,{Component} from 'react'
import Photo1 from './Photos/GoodFork1.jpeg'
import Photo2 from './Photos/GoodFork2.jpg'
import Display from './Display.js'
class Home extends Component{
    render(){

        const photos = [
            {photo:Photo1,
             text:"The Good Fork",
             url:"/the_good_fork"
            },
            {photo:Photo2,
             text:"Heuvos Rancherritos",
             url:"/food"
            },
            {photo:Photo1,
                text:"The Good Fork",
                url:"/me"
               },
               {photo:Photo2,
                text:"Heuvos Rancherritos"
               },
               {photo:Photo1,
             text:"The Good Fork"
            },
            {photo:Photo2,
             text:"Heuvos Rancherritos"
            },
            {photo:Photo1,
                text:"The Good Fork"
               },
               {photo:Photo2,
                text:"Heuvos Rancherritos"
               },

        ]

        return(
            <div class="row">

                {photos.map((e,i) =>
                        <Display 
                        photo={e.photo}
                        name={e.text}
                        key={i}
                        />
                    )}

            </div>
        )
    }
}

export default Home
